&lt;p&gt;
	Design, build, and test a 5,000 lbf thrust regeneratively cooled combustion chamber at JSC for a low pressure liquid oxygen/methane engine. The engine demonstrates its effectiveness by continuous steady state operation without catastrophic damage to the combustion chamber.&lt;/p&gt;
&lt;p&gt;
	This project will advance in three phases:&amp;nbsp; 1)&amp;nbsp; The addition of a regeneratively cooled test section to an existing pressure fed LOX/Methane engine.&amp;nbsp; This &amp;quot;partial regen&amp;quot; engine will be hot fire tested and thereby used to validate a multiphase regen cooling model. &amp;nbsp; 2) The development of a tube forming technique to construct a low cost full-size regeneratively cooled combustion chamber. &amp;nbsp; 3)&amp;nbsp; Using the results of #1 and 2, create a full scale regeneratively cooled combustion chamber (open loop cooling) for an existing 5,000 lbf subcritical liquid oxygen/methane rocket engine with variable chamber heat load capability.&amp;nbsp;&amp;nbsp; This full scale engine will be hot fire tested to demonstrate performance.&amp;nbsp;&lt;/p&gt;
